import React, { Component } from 'react';

function Item(props) {
    return (
        <image className="item">
            {this.props.items}
        </image>
    );
}

class HeroItems extends Component {
    renderItem(i) {
        return (
            <Item
                value={this.props.items[i]}
            />
        );
    }

    render() {
        return (
            <div className="hero-items__container">
                {this.props.items.map((img, index) => <img key={`hero-items-${index}`}>
                    src={img.src}
                    </img>
                )}
            </div>
        );
    }
}

export default HeroItems;
